treme extractivism, intensive extractivism, partial extractivism and weak extractivism).']='P132017',['Literature Review']='P132018',['The paper begins with an overview of the development theory and policy debates on the commodity-based development model and the implementation of indigenous rights. Finally, the question of whether sustainable practices of indigenous groups should be understood as an expression of their specific culture and whether these types of economic activity are relevant and realisable as models for a larger social context will be explored.']='P132019',['The relationship between resource-based developments and the implementation of indigenous autonomy rights has hardly been analysed to date. Numerous studies in the research field emphasise the importance of the recognition of indigenous rights for processes of social decolonisation and democratisation and identify their guarantee as a central prerequisite for the protection of ecologically sensitive regions (e.g. Bebbington et al. 2018). protection of ecologically sensitive regions. However, they often tend to focus indigenous groups in conflicts over land and resources on the defence of \"traditional ways of life\" and a \"harmonious relationship with nature\" and thus run the risk of ignoring important objectives which, in addition to the defence of land and raw materials, can also include coping with social change and improving the general living conditions of the affected population groups.']='P132020',['convariance']='P132021',['Mean absolute deviation']='P132022',['haslocation']='P132023',['Item type']='P132024',['URLs']='P132025',['PMID']='P132026',['subtask']='P132027',['Overshooting 1.5°C is fast becoming inevitable. Minimising the magnitude and duration of overshoot is essential']='P132028',['located in the administrative territorial entity']='wikidata:P131',['Insight 1']='P132029',['length']='wikidata:P2043',['Gloabal avarage tempreture']='P133000',['Global average temperature']='P13